const fontname = {
  face: function () {
    return `
      @font-face {

      }

      svg {
        width: 100%;
        height: auto;
        max-height: 150px;
      }

      .svg-jp-6 {
        font-family: 'GenEiAntiquePv5-M';
      }
    `
  }
}

export { fontname };
